import React, { useState } from 'react';
import './Gainers.css';

const initialProducts = [
  { name: 'Mass Gainer 1', price: '$49.99', imageUrl: '' },
  { name: 'Mass Gainer 2', price: '$54.99', imageUrl: '' },
  { name: 'Mass Gainer 3', price: '$59.99', imageUrl: '' },
  { name: 'Mass Gainer 4', price: '$64.99', imageUrl: '' },
  { name: 'Mass Gainer 5', price: '$69.99', imageUrl: '' },
  { name: 'Mass Gainer 6', price: '$74.99', imageUrl: '' },
  { name: 'Mass Gainer 7', price: '$79.99', imageUrl: '' },
  { name: 'Mass Gainer 8', price: '$84.99', imageUrl: '' },
  { name: 'Mass Gainer 9', price: '$89.99', imageUrl: '' },
  { name: 'Mass Gainer 10', price: '$94.99', imageUrl: '' },
  { name: 'Mass Gainer 11', price: '$99.99', imageUrl: '' },
  { name: 'Mass Gainer 12', price: '$104.99', imageUrl: '' }
];

const GainersPage = () => {
  const [products, setProducts] = useState(initialProducts);

  const handleImageChange = (index, event) => {
    const file = event.target.files[0];
    const reader = new FileReader();
    
    reader.onloadend = () => {
      const newProducts = [...products];
      newProducts[index].imageUrl = reader.result;
      setProducts(newProducts);
    };

    if (file) {
      reader.readAsDataURL(file);
    }
  };

  return (
    <div className="gainers-page">
      <h1 className="page-title">Gainers</h1>
      <div className="products-grid">
        {products.map((product, index) => (
          <div key={index} className="product-card" style={{ backgroundImage: `url(${product.imageUrl})` }}>
            <input
              type="file"
              accept="image/*"
              onChange={(event) => handleImageChange(index, event)}
              className="image-upload"
            />
            <div className="product-info">
              <h2 className="product-name">{product.name}</h2>
              <p className="product-price">{product.price}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default GainersPage;
